import React from 'react';
import ProductCard from './ProductCard';

const ProductList = () => {
  const products = [
    { id: 1, name: "Gold Diamond Ring", price: "₹45,000", image: "/images/ring.jpg" },
    { id: 2, name: "Emerald Necklace", price: "₹82,000", image: "/images/necklace.jpg" },
    { id: 3, name: "Pearl Earrings", price: "₹12,500", image: "/images/earrings.jpg" },
    { id: 4, name: "Luxury Bangle", price: "₹55,000", image: "/images/bangle.jpg" },
  ];
const ProductList = ({ addToCart }) => { // 1. Accept it here
  return (
    <div className="product-grid">
      {products.map(product => (
        <ProductCard 
          key={product.id} 
          product={product} 
          addToCart={addToCart} // 2. Pass it here
        />
      ))}
    </div>
  );
};
  return (
    <div className="container">
      <header className="header">
        <h1>NAKSH JEWELS</h1>
        <p>Exquisite Designs for Timeless Elegance</p>
      </header>
      <div className="product-grid">
        {products.map(product => (
          <ProductCard key={product.id} product={product} />
        ))}
      </div>
    </div>
  );
};

export default ProductList;
